import Task from "./task";
const Column = ({ column, tasks }) => {
  console.log("colum", column.title);
  return (
    <>
      <div>
        <h1> {column.title}</h1>
        <h2>
          {tasks.map((task) => (
            <Task key={task.id} task={task}></Task>
          ))}
        </h2>
      </div>
    </>
  );
};
export default Column;
